import { json } from '@sveltejs/kit';
import puppeteer from 'puppeteer';

export async function POST({ request }) {
    const data = await request.formData();
    const dataContent_temp = data.get('dataContent');
    const dataContent = JSON.parse(dataContent_temp);

    const contenidoHTML = generarContenidoHTML(dataContent);

    const pdfBuffer = await generarPDF(contenidoHTML, dataContent.name);

    return json(
        { 
            pdfBuffer: pdfBuffer.toString('base64'),
        }
    );
}

