const generarPDF = async (htmlContent, name) => {
    const browser = await puppeteer.launch();
    const page = await browser.newPage();
    await page.setContent(htmlContent, { waitUntil: 'networkidle2' });
    const pdfBuffer = await page.pdf({ format: 'A4', printBackground: true, width: '1000px', height: '2000px', landscape: true, path: `${name}.pdf`, });
    await browser.close();
    return pdfBuffer;
}